export class Search extends Component {
    constructor(){
        super();
        this.state({
            text:"",
        })
    }

    handlechange=(event)=>{
        this.setState({
            text:event.target.value,
        })
    }

    render() {
        return(
            <form className="d-flex container my-5">
        <input className="form-control me-2" type="search" placeholder="Search By City/Town" value={text} onChange={handlechange} aria-label="Search"/>
        <button className="btn btn-outline-success" type="submit">Search</button>
      </form>
        )
    }
}

export default Search
